    return (
    
    <div> 
        <section className="header">
          <p class="Name">Wei Chen</p>
          <button onClick={() => window.open('https://www.linkedin.com/in/wei-chen-38b084254/?trk=public-profile-join-page', '_blank')} className="Linkeldin">in</button>
        </section>
        <Navbar/>

